import './App.css';
import Main from "./Main";
import {
  HashRouter as Router,
  BrowserRouter,
  Routes,
  Route,
} from "react-router-dom";

function App() {
  return (
    <Router>
      {/* <div className="App">
        <Main/>
      </div> */}
      <div className='App'>
        <Routes>
          <Route path="" element={<Main/>}/>
        </Routes>
      </div>
    </Router>
  );
}

export default App;
